import "bootstrap/dist/css/bootstrap.min.css";
import { Table } from "react-bootstrap";
import "./styles.scss";

const UsuariosForm = () => {
  const headTable = [
    "Nombres",
    "Apellidos",
    "Identificacion (C.C)",
    "Rol Asociado",
    "Estado",
    "Teléfono",
    "CorreoElectronico",
    "Accion",
  ];

  return (
    <div>
      <Table responsive>
        <thead>
          <tr>
            {Array.from(headTable).map((_, index) => (
              <th key={index}>{_}</th>
            ))}
          </tr>
        </thead>
